import React from 'react'
import Profile from './Profile'
import Skills from './Skills'
import { skillsData } from '../../utility'

import {Container, Typography, Grid} from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  root: {
    marginTop: theme.spacing(10),
    marginBottom: theme.spacing(1)
  },
  component: {
    marginTop: theme.spacing(5)
  }
}))

function About() {
  const classes = useStyles()

  return (
    <Container justify="center" align="center"  className={classes.root}>
      <Typography variant="h4" align= "center" style={{fontWeight: "800", textDecoration: "underline"}}>ABOUT</Typography>

      <Grid container justify="space-around" className={classes.component}>
        <Grid item xs={12} sm={4} >
          <Profile />
        </Grid>
        <Grid item xs={12} sm={6}>
          {skillsData.map(skill => {
            return <Skills key={skill.id} {...skill} />
          })}
        </Grid>
      </Grid>
    </Container>
  )
}

export default About
